String getExerciseString(int index, String type) {
  String result = '';
  switch (type) {
    case 'name':
      result = exercises[index].name;
      break;
    case 'gifFilePath':
      result = exercises[index].gifFilePath;
      break;
    case 'description':
      result = exercises[index].description;
      break;
    case 'helpfulInfo':
      result = exercises[index].helpfulInfo;
      break;
    case 'type':
      result = exercises[index].type;
      break;

    default:
      result = 'Invalid type';
      break;
  }
  return result;
}
